import React from 'react';
import { BrowserRouter as Router, Route, Routes as RouterRoutes } from 'react-router-dom';
import Home from '../Pages/Home'; 
import Shop from '../Pages/Shop/Shop'; 
import Coaching from '../Pages/Coaching/Coaching';
import Services from '../Pages/Services/Service';
import SignIn from '../Pages/SignIn';
import Consulting from '../Pages/Consulting/Consulting';
import AdminDashboard from '../Pages/Admin/AdminDashboard';
import ManageUsers from '../Pages/Admin/ManageUsers/ManageUsers';

const AppRoutes = () => {
    return (
        <Router>
            <RouterRoutes>

                {/* Homepage */}
                <Route path="/" element={<Home />} />
                {/* Navbar */}
                <Route path="/shop" element={<Shop />} />
                <Route path="/services" element={<Services />} />
                <Route path="/coaching" element={<Coaching />} />
                <Route path="/consulting" element={<Consulting />} />

                {/* Sign In & Sign Up */}
                <Route path="/signIn" element={<SignIn />} />

                {/* Admin Dashboard */}
                <Route path="/admindashboard" element={<AdminDashboard />} />
                <Route path="/admindashboard/manage-users" element={<ManageUsers />} />
                <Route path="/admindashboard/manage-inventory" element={<ManageUsers />} />

            </RouterRoutes>
        </Router>
    );
}

export default AppRoutes;
